const tasks = [
  {
    id: 1,
    text: "Dr. Lang",
    day: "Mar 5 at 1:30pm",
    reminder: true,
  },
  {
    id: 2,
    text: "Bball",
    day: "Mar 12 at 8:30pm",
    reminder: false,
  },
  {
    id: 3,
    text: "Date night",
    day: "Mar 19 at 7:00pm",
    reminder: true,
  },
];
const Tasks = () => {
  return (
    <>
      {tasks.map((task) => (
        <h3>{task.text}</h3>
      ))}
    </>
  );
};

export default Tasks;
